import logo from './logo.svg';
import './App.css';
import { useState } from "react";
import VehicleOdom from './components/VehicleOdom';
import AtakStatus from './components/AtakStatus';
import INSstatus from './components/INSStatus';
import NavSat from './components/NavSat';
import SystemStatus from './components/VehicleOdom';

function App() {
  const [odom, setOdom] = useState({
    northing: 10.0,
    easting: 655432.21635,
    zone: [19, 'T'],
    depth: 15.0,
    heading: 59.5,
    pitch: 0.5,
    roll: 0.32,
  });

  const [atak, setAtak] = useState({ connected: true });

  const [gps, setGPS] = useState({ latitude: 54.211324, longitude: 45.324341 });

  const [ins, setINS] = useState({
    aligned: true,
    pos_valid: false,
    heading_valid: false,
    dvl_recv: true,
    dvl_used: false,
    lat_accuracy: 456.654,
    lon_accuracy: 854645.646,
  });

  const [sysstat, setSysstat] = useState({
    autonomy_state: 2,
    mission_loaded: true,
    mission_start: false,
    counting_down: false,
    awake: true,
  });

  return (
    <div className="app">
      <VehicleOdom odom={odom} />
      <AtakStatus atak={atak} />
      <NavSat gps={gps} />
      <INSstatus ins={ins} />
      <SystemStatus sysstat={sysstat} />
    </div>
  );
}

export default App;
